import { useEffect, useState } from "react";
import childService from "./services/child.service";

const App = () => {

  const [children, setChildren] =  useState([]);

  useEffect(() =>{
    childService.getAll()
    .then(response => {
      console.log('Printing children data',response.data);
      setChildren(response.data);
    })
    .catch(error => {
      console.log('Something went wrong',error);
    })

  }, [])

  return ( 
    <div>
      <h3>List of Admitted Children</h3>
      <div>
        <table border="1" cellSpacing="10">
          <tr>
            <td>SAM ID</td>
            <td>Name</td>
            <td>Age</td>
            <td>Gender</td>
            <td>Address</td>
            <td>Contact</td>
            <td>Height</td>
            <td>Weight</td>
          </tr>
          {
            children.map(child => (
              <tr key={child.samId}>
                <td>{child.samId}</td>
                <td>{child.name}</td>
                <td>{child.age}</td>
                <td>{child.gender}</td>
                <td>{child.address}</td>
                <td>{child.contact}</td>
                <td>{child.height}</td>
                <td>{child.weight}</td>
              </tr>
            ))
          }
        </table>
      </div>
    </div>
   );
}

export default App;
